export async function getCategoriesFromDB() {
    let response = await fetch('http://127.0.0.1:8000/api/categories/');
    let data = await response.json();
    return data.categories;
}

export async function getCompensations(categoryUrl) {
    let response = await fetch('http://127.0.0.1:8000/api/compensations/?category_url=' + categoryUrl);
    let data = await response.json();
    return data.compensations;
}
